{"description":"Burns down the bookshelf with the torch","code":"public static void BurnBookshelf(GameObject bookshelf, GameObject torch) 
{ 
GameObject.Destroy(bookshelf); 
}"}

{"description":"The torch burns the wizard hat, causing it to disappear","code":"public static void BurnWizardHat(GameObject torch, GameObject wizardHat) 
{ 
GameObject.Destroy(wizardHat); 
}"}
